import { BrowserRouter, Router, Route } from 'react-router-dom';
import Footer from './Components/Footer';
import Header from './Components/Header';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Router>
        <Route path="/" element={<Footer />} />
      </Router>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
